(7, 'Zoya Zaidi', 'zoya.zaidi@packages.com.pk', 'This looks cool.', 1, NULL, '2018-11-15 09:52:49', '2019-02-27 06:52:21'),
(8, 'Fatima Qadir', 'fatima.qadir@packages.com.pk', 'The new and improved version of the intranet looks great. \r\nLooking forward to seeing updates daily! :)', 1, NULL, '2018-11-16 10:51:40', '2018-11-16 10:52:02'),
(10, 'Fahad Majeed', 'fahad.majid@packages.com.pk', 'Refreshing to see the updated version of the intranet. Daily updates and Feedback section are much needed steps in the right direction. Well done to all who are behind this most welcome change. Keep up the good work!!!', 1, NULL, '2018-11-16 12:03:04', '2018-11-16 12:17:04'),
(11, 'Sardar M. Aurangzaib', 'sardar.aurangzaib@packages.com.pk', 'Congratulations to all the team. Good job with the new changes.', 1, NULL, '2018-11-16 12:46:59', '2018-11-16 14:48:37'),
(12, 'Ameer Hamza', 'ameer.hamza@packages.com.pk', 'This  version of intranet is more user friendly and informative having pretty good interface from previous one. :)', 1, NULL, '2018-11-16 14:29:46', '2018-11-16 14:48:35'),
(13, 'Arsalan Siddiqi', 'arsalan.siddiqi@packages.com.pk', 'Please give Saturdays off!', 1, NULL, '2018-11-19 09:37:36', '2018-11-19 09:44:18'),
(14, 'Talha Umar', 'talha.umar@packages.com.pk', 'Saturdays off please.', 1, NULL, '2018-11-19 09:37:41', '2018-11-19 09:44:20'),
(15, 'Arsalan Siddiqi', 'arsalan.siddiqi@packages.com.pk', 'Much better form of the intranet. This is much more user friendly and a great initiative! Looking forward to seeing more things added to this soon', 1, NULL, '2018-11-19 09:43:08', '2018-11-19 09:44:23'),
(16, 'Hadi Ahmed Shaheen', 'hadi.ahmed@packages.com.pk', 'Car parking should be improved.', 1, NULL, '2018-11-19 10:54:14', '2018-11-19 11:35:34'),
(17, 'Awais Haider', 'awais.haider@packages.com.pk', 'Please give Saturdays off.', 1, NULL, '2018-11-19 12:49:31', '2018-11-19 14:15:06'),
(18, 'Talha Umar', 'talha.umar@packages.com.pk', 'Cant download HR policies.', 0, NULL, '2018-11-19 14:55:50', '2019-03-11 04:45:32'),
(19, 'Hassan ', 'hassan.mehdi@packages.com.pk', 'I agree with previous comments, car parking should be improved and Saturdays should be off. \r\nHealthy meal options should also be available', 1, NULL, '2018-11-19 14:58:44', '2019-02-27 06:52:02'),
(20, 'Musa Ejaz', 'musa.ejaz@packages.com.pk', 'We as a Packages Family should have perks & benefits in Packages mall as well.', 1, NULL, '2018-11-20 15:59:26', '2018-11-22 09:47:04'),
(21, 'Syed Hyder Ali', 'hyder.ali@packages.com.pk', 'Good Job done by Systems and HR at re-launching the intranet. Great way to keep the employees updated and bridges the gap between divisions and departments.', 1, NULL, '2018-11-22 13:09:38', '2018-11-22 13:10:42'),
(27, 'Khurram Mannan', 'khurram.mannan@packages.com.pk', 'Great Intranet. Parking needs improvement and Saturdays off please. :)', 1, '172.16.28.100', '2018-11-24 12:39:56', '2018-11-24 12:42:35'),
(28, 'Umer farooq', 'umer.farooq@packages.com.pk', 'most of the thongs missing on new portal of interanet. i.e. QA & EHS data, material number creation.', 0, '172.16.28.141', '2018-11-29 06:01:06', '2018-11-29 06:44:00'),
(29, 'Zaara Ehsaan', 'zaara.ehsaan@packages.com.pk', 'A fine portal. Thank you.\r\nCould we ask for a treading path to be built around that Hockey ground? Surely without cutting the trees surrounding it, For the purpose of walk or running... Is that somehow possible?', 1, '172.16.28.133', '2018-12-17 07:31:01', '2018-12-17 09:23:34'),
(30, 'Ali Ahmad Khan', 'ali.ahmad@packages.com.pk', 'Quality of Food can be improved at Mess especially meaty stuff. I will be happy if any one responds to all such suggestions :)\r\n\r\nAnyhow, Nice Portal !', 1, '172.16.30.33', '2018-12-21 07:02:03', '2018-12-22 09:50:39'),
(31, 'Ameer Hamza', 'ameer.hamza@packages.com.pk', 'food was unbearable today action should be taken ASP for the betterment of mess quality and employee health.', 1, '172.16.29.231', '2018-12-22 09:13:41', '2018-12-22 09:50:41'),
(32, 'Muhammad Sajid', 'muhammad.sajid@packages.com.pk', 'Saturdays off please.', 1, '', '2018-12-27 04:18:16', '2018-12-28 02:45:51'),
(33, 'Faizan Rashid', 'faizan.rashid@packages.com.pk', 'Great Intranet. Mess Food can be improved & Saturdays off please. :)', 1, '172.16.29.97', '2018-12-28 05:45:23', '2019-01-04 06:41:20'),
(34, 'Saman Jafri', 'saman.jafri@packages.com.pk', 'Saturdays should be off please :)', 1, '192.168.0.113', '2019-01-10 07:35:53', '2019-01-10 07:37:01'),
(35, 'Fatima Qadir', 'fatima.qadir@packages.com.pk', 'Saturdays need to be off, to allow for better work life balance without decreasing the working hours of employees.', 1, '192.168.0.117', '2019-01-10 07:36:39', '2019-01-10 07:36:59'),
(36, 'Noor-ul-nisa Butt', 'noor.butt@packages.com.pk', 'Please improve the quality & the variety of food in mess. Half of the employees don\'t go to mess on days when \"alloo shimla mirch\" or \"alloo anda curry\" is made. Surely such days can be highlighted to the IR team and taken action on. Waste can be reduced.', 1, '172.16.30.245', '2019-01-14 07:36:36', '2019-01-15 04:52:50'),
(37, 'Salman Javaid Mirza', 'salman.mirza@packages.com.pk', 'There is no linking of PPP to the increment appraisal process!!!!', 1, '172.16.30.172', '2019-01-16 09:53:08', '2019-02-27 06:52:16'),
(38, 'Muhammad Wajahat Hussain', 'wajahat.hussain@packages.com.pk', 'There must be incentive for field engineers to keep them motivated to work in odd hours Because of severity, sensitivity and criticality of their work for organization.', 1, '172.16.28.217', '2019-02-11 06:48:51', '2019-02-11 07:39:36'),
(39, 'Noman Sabir', 'noman.sabir@packages.com.pk', 'Field operation Engineers/Managers are organization\'s driving wheels so they should be highly motivated through special Growth/Training/Incentives to keep them on winning track towards market competition and plant efficiency.', 1, '172.16.30.202', '2019-02-14 12:13:02', '2019-02-21 03:43:01'),
(40, 'Hassan Mehdi', 'hassan.mehdi@packages.com.pk', 'Internet needs to be improved as it slows down productivity', 1, '172.16.29.34', '2019-02-20 10:35:05', '2019-02-21 03:42:53'),
(41, 'Syed Hassan Mehdi', 'hassan.mehdi@packages.com.pk', 'Saturdays off please!!! And fix the parking as well.', 0, '172.16.20.77', '2019-02-26 07:20:51', '2019-03-11 07:45:49'),
(42, 'Ali', 'ali.wajid@packages.com.pk', 'There is a typo in timeline showing LPG event on 28 Mar 2019. BR', 1, '172.16.29.33', '2019-03-22 04:49:46', '2019-05-06 05:19:30'),
(43, 'Khalid Bashir', 'khalid.bashir@packages.com.pk', 'I am applying for Murree Guest House for more than 6 Years now, never got a chance to avail this opportunity. There must be provision for those who couldn\'t avail a single chance despite applying in last 4-5 Years.', 1, '172.16.29.175', '2019-03-22 11:19:52', '2019-03-29 04:32:32'),
(44, 'Talha Umar', 'talha.umar@packages.com.pk', 'Yayy Saturdays offfff!!!', 1, '172.16.20.77', '2019-04-05 06:00:07', '2019-05-06 05:18:50'),
(45, 'Rana Aftab Ahmad', 'rana.aftab@packages.com.pk', 'Kindly improve the quality & the taste of food in mess, so that wastage can be reduced.', 1, '172.16.29.170', '2019-04-15 04:44:16', '2019-05-06 05:18:53'),
(46, 'Noor-ul-nisa Butt', 'noor.butt@packages.com.pk', 'Ramzan timings should be same as before - till 3:30 pm. As we won\'t be getting any break in between. Also, many employees will be reaching home after 6  which gives you less time to prepare of iftar.', 1, '172.16.30.245', '2019-04-30 11:57:08', '2019-05-06 05:18:45'),
(47, 'Noor-ul-nisa Butt', 'noor.butt@packages.com.pk', 'Ramzan timings should be same as before - till 3:30 pm. As we won\'t be getting any break in between. Also, many good companies give leniency in timings during the month of Ramazan.', 1, '172.16.30.245', '2019-04-30 11:59:05', '2019-05-06 05:18:55'),
(48, 'Noor-ul-nisa Butt', 'noor.butt@packages.com.pk', 'Ramzan timings should be same as before - till 3:30 pm. As we won\'t be getting any break in between. Also, many good companies give leniency in timings during the month of Ramazan.', 1, '172.16.30.245', '2019-04-30 12:00:15', '2019-05-06 05:19:02'),
(49, 'Omer Iqbal', 'omer.iqbal@packages.com.pk', 'Gate # 2 should be functional for at-least pedestrians to avoid inconvenience especially in Summer. Because when an employee reaches at his workplace after passing through this long route (via gate#1), he needs at-least an hour to settle down.', 1, '172.16.29.208', '2019-05-06 04:24:27', '2019-05-06 05:18:59'),
(54, 'Sajjad', 'sajjad.ahmed@packages.com.pk', 'Management needs to review Ramzan timings. Employees should not be asked to stretch more than 6 hours at work during fasting. Please consider.', 1, '192.168.8.182', '2019-05-06 05:00:15', '2019-05-06 05:19:11'),
(58, 'Ismail Zubairy', 'ismail.zubairy@packages.com.pk', 'Ramadan timings should be reduced. All our major customers have a considerable reduction in working hours for Ramadan :)\r\n\r\nRegular Working Hours: 8\r\nRamadan Working Hours: 7.5 :\'( :\'(', 1, '192.168.8.67', '2019-05-06 05:06:05', '2019-05-06 05:19:22'),
(69, 'Faizan Suhail', 'faizan.suhail@packages.com.pk', '1) Parking area should be shifted back to Packages Ltd. in summers & a designated area should be assigned to restrict the vehicle movement in office hours.\r\n2) Ramzan Office timings should be from 10:00 AM to 05:00 PM, it will increase employee efficiency', 1, '172.16.30.235', '2019-05-06 07:44:30', '2019-05-07 03:28:55'),
