(93, 'Zeenia Ather', 'zeenia.ather@packages.com.pk', 'It is ironic how none of the decision makers except for Nayab are using the beautiful shuttle service. Trust me in this heat and ramzan if they take this service for one week. I am sure the decision would reverse.  \r\nUnhappy employees = low motivation', 1, '172.16.29.136', '2019-05-22 04:20:09', '2019-05-23 04:31:30'),
(94, 'Faizan Rashid', 'faizan.rashid@packages.com.pk', 'Shuttle service is never available after 5 Pm.There are numerous people who leave by 5: 30 or even 6:00. It is a diservice to those who stay longer and complete their work yet are not provided shuttle service.', 1, '172.16.29.97', '2019-05-31 07:01:26', '2019-06-03 03:03:57'),
(95, 'Zoya Zaidi', 'zoya.zaidi@packages.com.pk', 'The drivers of the carts keep changing which is why everyone has difficulty finding the carts or waiting for the carts. No one wants to wait in this heat. It is unfair an against our value \'care\'. If the drivers are being changed, we should be informed.', 1, '192.168.0.113', '2019-06-10 08:14:23', '2019-06-11 05:57:28'),
(96, 'Zeenia Ather', 'zeenia.ather@packages.com.pk', 'Please install cameras in the parking lot of mall as our cars are getting hit and we have no clue what to do with the damaged and scratched bumpers. It has happened to 3 more colleagues as well.', 1, '172.16.29.136', '2019-06-14 04:45:28', '2019-06-17 07:38:37'),
(97, 'M Nouman Zafar', 'nouman.zafar@packages.com.pk', 'My car bumper has been damaged twice in the parking area besides Food stalls; need to keep a check on wrong parking in that area.', 0, '172.16.28.210', '2019-06-17 09:59:15', '2019-06-19 03:27:01'),
(98, 'M Nouman Zafar', 'nouman.zafar@packages.com.pk', 'My car bumper has been damaged twice in the parking area besides Food stalls; need to keep a check on wrong parking in that area.', 0, '172.16.28.210', '2019-06-17 09:59:55', '2019-06-19 03:27:03'),
(99, 'M Nouman Zafar', 'nouman.zafar@packages.com.pk', 'My car bumper has been damaged twice in the parking area besides Food stalls; need to keep a check on wrong parking in that area.', 1, '172.16.28.210', '2019-06-17 10:02:06', '2019-06-19 03:26:59'),
(100, 'Zeenia Ather', 'zeenia.ather@packages.com.pk', 'Now we cant even park inside the mall. HR please have mercy on us. Look at the heat. Please raise our concerns. This is a peoples issue. Just conduct a survey and you will know the sentiment.', 1, '172.16.29.136', '2019-06-21 04:55:44', '2019-06-21 06:34:42'),
(101, 'ali wajid', 'ali.wajid@packages.com.pk', 'how come mall employees can park cars inside while we can not. Isn\'t this discrimination?', 1, '172.16.29.33', '2019-06-21 06:32:58', '2019-06-21 06:34:42'),
(102, 'M. Adnan Asad', 'adnan.asad@packages.com.pk', 'Its time to release Car Loan policy, recently no one is aware when hell be eligible and what is the basis.\r\nIn fact, there is a lot of discrimination inter-departments having same Grades, and still they havent got the loan while serving for years.!', 1, '', '2019-09-18 09:31:35', '2019-09-18 09:48:22'),
(103, 'Sagheer Ahmad', 'sagheer.ahmad@packages.com.pk', 'Dear Sir;\r\nIn Telephone directory there is no person presence from  Business Unit Roll Covers/Workshop ; pls add', 1, '172.16.30.86', '2019-10-23 12:09:12', '2019-10-29 04:33:44'),
(104, 'Numan Noor', 'numan.noor@gmail.com', 'Time Management system , Leave request page is not showing details on one page . One lost track of the kind of leave balance while navigating from left to right . Suggest IT , to make it concise on one page .', 1, '172.16.30.41', '2019-10-29 04:21:02', '2019-10-29 04:33:47'),
(105, 'Mazahir Hussain', 'mazahir.hussain@packages.com.pk', 'I have heard that daycare center facility can not be availed by male employees. Is there any specific reason for this? There could be single fathers or fathers with working wives who want to avail this facility.', 1, '172.16.28.216', '2019-10-29 07:33:00', '2019-10-29 09:05:35'),
(106, 'M. Adnan Asad ', 'adnan.asad@packages.com.pk', 'Annual Leaves  Reservations!\r\n1-Everyone is confused on Annual leaves balance upon next year entitlement and Casuals treatment.\r\n2-Annual Leaves policy is not consistent across the Group.\r\n3-MNCs encash Upper limit balance every year, rather than wasted', 1, '172.16.30.59', '2019-10-30 10:10:11', '2019-10-30 10:10:54'),
(107, 'Zeenia Ather', 'zeenia.ather@packages.com.pk', 'There is not enough parking space in the dedicated employee parking at the mall. Because of the cones 15-20 cars that were initially accommodated in the parking also have moved to other zones.  Guards don\'t let you park near the pink gate as well.', 1, '172.16.29.136', '2019-11-01 06:30:40', '2019-11-01 06:36:34'),
(108, 'Hassan Salman Shaikh', 'hassan.salman@packages.com.pk', 'I\'m not allowed to park my car inside the mall building as I am just an employee and not a customer.  I myself have been spending thousands in mall on shopping for clothing, meals and grocery. Am i not a customer of packages mall and spend somewhere else?', 1, '172.16.28.111', '2019-11-01 06:37:30', '2019-11-01 06:38:35'),
(109, 'Tuba Ajmal', 'tuba.ajmal@packages.com.pk', 'We are employees of Packages Limited and not Packages Mall which is why we do not get the respect of a customer, despite spending thousands of Rs every month. Our vehicles are pushed further away and we are shoved off by the security making us embarassed', 1, '172.16.30.152', '2019-11-01 06:49:46', '2019-11-01 06:52:04'),
(110, 'Sabih Ahmad', 'sabih.ahmad@packages.com.pk', 'I thank to Packages Ltd. for giving insurance facility but it needs a lot of improvement in his claim process.', 1, '172.16.29.27', '2019-11-07 11:10:06', '2019-11-14 03:33:44'),
(111, 'Nisar Ahmed', 'nisar.ahmed@packages.com.pk', 'Karachi Office timming on Friday is 30 minutes excess than  Lahore Office timming. (i.e. 08:30 to 18:00 hrs), Please consider', 1, '', '2019-11-13 11:29:39', '2019-11-14 03:33:48'),
(112, 'Adeel Qayyum', 'adeel.qayyum@packages.compk', 'Balance of remaining Annual leaves for the year should be en-cashed at year end.', 1, '172.16.20.110', '2019-11-18 07:40:51', '2019-11-19 03:12:14'),
(113, 'Shoaib Nangiana', 'shoaib.nangiana@packages.com.pk', 'Whats the use of Sub Keh do once we have a whistle blowing policy. Isn\'t it duplication? Minor issues/irritants are otherwise supposed  to be taken up by the concerned managers.  \r\nBR,\r\nShoaib Nangiana', 1, '', '2019-11-25 07:05:02', '2019-11-28 03:17:32'),
(114, 'Sahar Najam', 'sahar.najam@packages.com.pk', 'What is the  car parking challan money used for? I suggest that accumulated money on quarterly basis is used for a lucky draw', 0, '172.16.20.195', '2019-12-19 11:28:51', '2019-12-19 11:35:39'),
(115, 'Sahar Najam', 'sahar.najam@packages.com.pk', 'What is the parking challan money used for? I suggest that it\'s used as a lucky draw (quarterly or bi-yearly basis) for non managerial staff.', 1, '172.16.20.195', '2019-12-19 11:33:53', '2019-12-19 11:35:37'),
(116, 'faheem ahmad', 'faheem.ahmad@packages.com.pk', 'Annual leaves should be encashed at the end of year.', 1, '', '2019-12-20 09:03:38', '2019-12-30 03:12:22'),
(117, 'Mahnoor Pasha', 'mahnoor.pasha@packages.com.pk', 'There should be lights at regular intervals at the footpath area outside gate 1 of Packages Mall till gate 2 of Packages Limited. The service lane area is pretty dark and isolated and hence, an easy spot for muggers.', 1, '', '2019-12-20 13:01:42', '2019-12-30 03:12:25'),
(118, 'Ismail Azeem Zubairy', 'ismail.zubairy@packages.com.pk', 'Government Holidays for Karachi should be uniform for all group companies. BSPL Karachi office (like most Karachi based companies) is given off as per Sindh government\'s announcements yet Packages Karachi office is not.', 1, '', '2019-12-27 12:14:37', '2019-12-30 03:12:27'),
(119, 'Maheen Khan', 'maheen.khan@packages.com.pk', 'Despite of several complaints from various employees, hand scan attendance machine near internal audit department does not work.', 1, '172.16.20.52', '2020-01-13 04:22:10', '2020-01-28 05:14:33'),
(120, 'SAMI ULLAH', 'sami.ullah@packages.com.pk', 'Office timing must be 9:00 to 18:00', 1, '172.16.29.78', '2020-01-23 04:51:53', '2020-02-18 09:53:12'),
